namespace WEBAPI_VOPAK.Models.Componentes
{
    using Newtonsoft.Json;
    using System;
    using System.Collections.Generic;
    using System.Configuration;
    using System.IO;
    using System.Net;
    using System.Net.Http;
    using System.Text;
    using System.Threading.Tasks;
    using System.Web.Script.Serialization;

    public class CameraUtil
    {

        public static string SemImagem
        {
            get
            {
                return "";
            }
        }
        public static byte[] SemImagemBytes
        {
            get
            {
                return Convert.FromBase64String(SemImagem);
            }
        }


        /// <summary>
        /// Retorna uma coleção de imagens em formato Base64 capturadas pelo equipamento indicado.
        /// </summary>
        /// <param name="listCamBalanca">Lista de equipamentos (câmeras).</param>
        /// <param name="framesPorCamera">Indica quantas imagens devem ser capturadas. O padrão é 1.</param>
        /// <returns>As imagens capturadas.</returns>
        public static List<string> CapturaFrames(List<CameraEquipamento> listCamBalanca, int framesPorCamera)
        {
            List<string> ret = new List<string>();
            if (framesPorCamera <= 0)
                return ret;
            for (int index = 0; index < listCamBalanca.Count; ++index)
                ret.Add(CameraUtil.GetFrame(listCamBalanca[index]));
            return ret;
        }

        /// <summary>
        /// Retorna o handler para as credenciais do serviço de cliente da Web.
        /// </summary>
        /// <param name="conta">Conta de acesso ao serviço</param>
        /// <param name="senha">Senha de acesso ao serviço</param>
        private static HttpClientHandler Handler(string conta, string senha)
        {
            NetworkCredential networkCredential = new NetworkCredential(conta, senha);
            HttpClientHandler httpClientHandler = new HttpClientHandler();
            httpClientHandler.Credentials = networkCredential == null ?
                (ICredentials)null :
                (ICredentials)networkCredential;
            httpClientHandler.UseDefaultCredentials = networkCredential == null;
            httpClientHandler.UseProxy = false;
            return httpClientHandler;
        }

        /// <summary>
        /// Retorna um único frame à partir do equipamento indicado.
        /// </summary>
        /// <param name="camera">Equipamento (câmera)</param>
        /// <returns>Imagem capturada como Base64.</returns>
        public static string GetFrame(CameraEquipamento camera)
        {
            string ret = SemImagem;
            try
            {
                byte[] result = null;
                try
                {
                    using (HttpClient client = new HttpClient((HttpMessageHandler)Handler(camera.Conta, camera.Senha)))
                    {
                        client.BaseAddress = new Uri(camera.DsLinkCameraVideo);
                        client.Timeout = TimeSpan.FromSeconds(2);
                        result = client.GetByteArrayAsync(camera.DsLinkCameraVideo).Result;
                    }
                }
                catch { }
                if (result != null)
                    ret = Convert.ToBase64String(result);
            }
            catch (Exception ex) { ex.Log(); ret = SemImagem; }
            return ret;
        }

        /// <summary>
        /// Tenta conectar ao servidor Carmen e submeter uma imagem em formato 
        /// Base64 para que ele retorne se detectou alguma placa.
        /// </summary>
        /// <param name="base64">Imagem à ser enviada.</param>
        /// <returns>
        /// Objeto json de resposta do serviço do Carmen, sem
        /// as marcas XML.
        /// </returns>
        public static async Task<string> GetCarmenApi(string base64)
        {
            string ret = "";
            if (ConfigurationManager.AppSettings["ServidorLAP"] == null)
                ret = "Servidor Lap não foi encontrado";
            else
            {
                try
                {
                    Dictionary<string, string> dicionario = new Dictionary<string, string>();
                    dicionario.Add("lane", "31");
                    dicionario.Add("id", "1");
                    dicionario.Add("timeout", "1000");
                    dicionario.Add("bytes", base64);
                    object serializado = JsonConvert.SerializeObject(dicionario);
                    string content = JsonConvert.SerializeObject(serializado);
                    string str2 = string.Format("http://{0}", (object)ConfigurationManager.AppSettings["ServidorLAP"].ToString());
                    Encoding utF8 = Encoding.UTF8;
                    StringContent stringContent = new StringContent(content, utF8, "application/json");
                    HttpRequestMessage httpRequestMessage = new HttpRequestMessage() { Method = HttpMethod.Post, RequestUri = new Uri(str2) };
                    using (HttpClient client = new HttpClient())
                    {
                        HttpResponseMessage httpResponseMessage = await client.PostAsync(str2, (HttpContent)stringContent).ConfigureAwait(false);
                        if (httpResponseMessage.StatusCode == HttpStatusCode.BadRequest) throw new Exception("PlateNotFound");
                        string result = httpResponseMessage.Content.ReadAsStringAsync().Result;
                        string str3 = result.Substring(result.IndexOf("{"));
                        while (!str3.EndsWith("}"))
                            str3 = str3.Substring(0, str3.Length - 1);
                        ret = str3.Replace("\\", "");
                    }
                }
                catch (Exception ex) { ex.Log();  ret = ""; }
            }
            return ret;
        }

        /// <summary>
        /// Processa uma lista de imagens junto ao servidor do Carmen para obter os scores.
        /// </summary>
        /// <param name="ambiente"></param>
        /// <param name="imgsBase64"></param>
        /// <param name="captura"></param>
        /// <returns></returns>
        public static Carmen GetCarmenLevenstein(string ambiente, List<string> imgsBase64, Captura captura )
        {
            Carmen carmen1 = new Carmen();
            Carmen carmen2 = new Carmen();
            string str = "";
            foreach (string base64 in imgsBase64)
            {

                try
                {
                    int totalConfidence = carmen1.totalConfidence;
                    carmen2 = new JavaScriptSerializer().Deserialize<Carmen>(CameraUtil.GetCarmenApi(base64).Result);
                    if (carmen2.totalConfidence >= totalConfidence)
                    {
                        carmen1 = carmen2;
                        carmen1.base64 = base64;
                    }
                    str = "ok";
                }
                catch (Exception ex) { ex.Log(); str = str == "ok" ? "ok" : "error"; }

                if (carmen1.plate != null && !string.IsNullOrEmpty(carmen1.plate) && (captura.NumOs > 0 && carmen1 == carmen2))
                {
                    string placa = Dados.PlacaDaOS(ambiente, captura.NumOs);
                    //string placa = new CapturaBusiness().PesquisarMotivacaoBusiness(captura).Placa;
                    float num = carmen1.plate.Compare(ref placa);
                    if ((double)num >= (double)carmen1.score)
                    {
                        carmen1.score = num;
                        carmen1.ConfirmedPlate = placa;
                    }
                }

                if (carmen1.plate == null || string.IsNullOrEmpty(carmen1.plate))
                {
                    carmen1.confidence = "0";
                    carmen1.proc = "";
                    carmen1.ptype = "";
                    carmen1.score = 0.0f;
                }
            }
            carmen1.score = (float)((double)carmen1.score / (double)byte.MaxValue * 100.0);
            if (str == "ok")
                return carmen1;
            return (Carmen)null;
        }
    }
}